def show_samples(data):

    fig, ax = plt.subplots(4, 5, figsize = (15, 8))
    index = 1

    for column in range(0, 5):
        for row in range(0, 4):
            ax[row, column].imshow(data[index].reshape(28,28), cmap = "Greys_r")
            ax[row, column].axis(False)
            index += 200

    plt.show()
